We present a guide through Museum and galleries of Ljubljana (MGML)!

The app will be a great companion for those who want to learn more about history of Ljubljana and Slovenia through museum artefacts and art.

Want to know more about an artefact or artwork you're looking at? Just open the app, point the camera at the object or canvas and within a few seconds you'll get information about the provenance, artist and a short description.

Tired of following a guide all around the museum? Now you'll always have a free audio guide close by. Learn mora about the artefacts and artwork you like!

You don't have to go to the museum or gallery to experience the beauty of art. Now you can view most of the collections of MGML without leaving home. The most interesting artefacts and best artworks are on your smartphone!

Use the MGML guide to:
- get full information about the museum and galleries, from their location on the map, opening hours to reviews;
- keep up with events on the news feed;
- view high-quality images of the museum artefacts and artworks;
- look through characteristics and annotations of artefacts and artworks;
- search for interesting artefacts and artworks by filters, from title and artist to size, materials and style of art;
- read the biographies of the most outstanding artists and masters whose works are displayed at the museum and galleries;
- read announcements and details of past, present and future exhibitions;
- comment on artefacts, artworks, news and exhibitions and share them on social media.

Study the museum items, masterpieces of art, visit the museum and galleries and share your interests with friends at any convenient time!
If you have any questions, please contact us at inforotor.corp@gmail.com. We look forward to hearing your suggestions about our app.

